def simp(x):
    return simplify(x)


def getRegisterInit():
    registerInit = {}
    for i in range(0, 13):
        registerInit[i] = constant(0, 32)
    registerInit[13] = constant(0x7fff0000, 32)
    registerInit[14] = constant(0, 32)
    registerInit[15] = constant(0x00008030, 32)
    return registerInit


